import './App.css';
import Header from '../Header/Header';
import Footer from '../Footer/Footer';
import Main from '../Main/Main';

function App() {
  return (
    <div className="App">

      <Header>
        <NavBar loggedIn={loggedIn} email={email} signOut={signOut}/>
      </Header>

      <Routes exact path='/' element={
        <Main />

      }/>

      <Footer />
    </div>
  );
}

export default App;
